import React from 'react'
import Button from 'react-bootstrap/Button';
import Card from 'react-bootstrap/Card';

function NoviceDetails ({ nproduct }) {
    console.log(nproduct)
    return (
        <Card className = "my-3 p-3 rounded">
            <Card.Img variant="top" src="https://images.unsplash.com/photo-1663738017510-00aaa40ba441?ixlib=rb-1.2.1&ixid=MnwxMjA3fDB8MHx0b3BpYy1mZWVkfDI0fEJKSk10dGVESkE0fHxlbnwwfHx8fA%3D%3D&auto=format&fit=crop&w=600&q=60" />
            <Card.Body>
                <Card.Title>{nproduct.name}</Card.Title>
                <Card.Text>
                    {nproduct.description}
                </Card.Text>
                <Button className="btn btn-success rounded-full mr-2">
              Buy Now!
        
            </Button>
            <Button className="btn btn-danger rounded-full mr-2">
              Buy Now!
        
            </Button>
            </Card.Body>
        </Card>

    )
}

export default NoviceDetails;
